import './App.css';
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Header from './Components/Header';

const Home = () => <h1></h1>;
const QuemSomos = () => <h1>Quem Somos</h1>;
const Services = () => <h1>Astoria Page</h1>;
const Pacotes = () => <h1>Serenata Page</h1>;
const FaleConosco = () => <h1>Bravura Page</h1>;
const Blog = () => <h1>Mar√≠tima Page</h1>;
const Cambio = () => <h1>Veloz Page</h1>;

function App() {
  return (
    <Router>
      <Header />
      <Routes>
        <Route path="/home" element={<Home />} />
        <Route path="/QuemSomos" element={<QuemSomos />} />
        <Route path="/Services" element={<Services />} />
        <Route path="/Pacotes" element={<Pacotes />} />
        <Route path="/FaleConosco" element={<FaleConosco />} />
        <Route path="/Blog" element={<Blog />} />
        <Route path="/Cambio" element={<Cambio />} />
      </Routes>
    </Router>
  );
}

export default App;
